{
    "parameters": [
        {
            "name": "delimiter",
            "description": "delimiter which needs to be applied while parsing the csv",
            "defaultValue": ","
        },
        {
            "name": "handleEmptyCells",
            "description": "this parameters can be set to \"setToNull\" or \"setToEmptyString\". If the CSV file has empty cells setting the value to one of the attribute will convert the empty cell into an empty string or null.",
            "defaultValue": "setToEmptyString"
        }
    ],
    "requiresFileUpload": true
}

{
    "name": "test-input-connector",
    "description": "Input connector for video",
    "requiresFileUpload": false,
    "type": "input",
    "parameters": [{
        "name": "dataSet",
        "description": "The data set to return - A, B, or C",
        "required": true
    }]
}

{
        "transformer": {
        "transforms": [
            {
                "index": 0,
                "formula": "AS_TIMESTAMP(:timestamp, 'yyyy-MM-dd\\'T\\'HH:mm:ss.SSSXXX')",
                "outputs": [
                    {
                        "description": "Time of input data",
                        "index": 0,
                        "key": "timestamp",
                        "label": "Timestamp",
                        "type": "timestamp"
                    }
                ]
            },
            {
                "index": 1,
                "formula": ":a",
                "outputs": [
                    {
                        "description": "Value of a",
                        "index": 0,
                        "key": "a",
                        "label": "A",
                        "type": "number"
                    }
                ]
            },
            {
                "index": 2,
                "formula": ":b",
                "outputs": [
                    {
                        "description": "Value of b",
                        "index": 0,
                        "key": "b",
                        "label": "B",
                        "type": "number"
                    }
                ]
            },
            {
                "index": 3,
                "formula": ":c",
                "outputs": [
                    {
                        "description": "Value of c",
                        "index": 0,
                        "key": "c",
                        "label": "C",
                        "type": "number"
                    }
                ]
            },
                        {
                "index": 4,
                "formula": ":c > :a",
                "outputs": [
                    {
                        "description": "C > A",
                        "index": 0,
                        "key": "cgta",
                        "label": "CgtA",
                        "type": "boolean"
                    }
                ]
            },
                        {
                "index": 5,
                "formula": ":c < :a",
                "outputs": [
                    {
                        "description": "C < A",
                        "index": 0,
                        "key": "clta",
                        "label": "CltA",
                        "type": "boolean"
                    }
                ]
            },
            {
                "index": 6,
                "formula": "CONCAT(:a,'-',:b,'-',:c)",
                "outputs": [
                    {
                        "description": "All values concatanated",
                        "index": 0,
                        "key": "concatValues",
                        "label": "ConcatValues",
                        "type": "string"
                    }
                ]
            }
        ],
        "parameters": [
            {
                "index": 0,
                "key": "timestamp",
                "label": "Timestamp",
                "description": "Timestamp of input data",
                "type": "string"
            },
            {
                "index": 1,
                "key": "a",
                "label": "A",
                "description": "Value of A",
                "type": "number"
            },
            {
                "index": 2,
                "key": "b",
                "label": "B",
                "description": "Value of B",
                "type": "number"
            },
            {
                "index": 3,
                "key": "c",
                "label": "C",
                "description": "Value of C",
                "type": "number"
            }
        ]
    }

}

{
    "name": "Assign to Groups Test",
    "description": "Test pipeline for Assign to Groups",
    "processorOptions": {
        "chunkSize": 1
    },
    "connectorConfig": {
        "input": [
            {
                "name": "sif-csv-pipeline-input-connector"
            }
        ]
    },
    "transformer": {
        "transforms": [
            {
                "index": 0,
                "formula": "AS_TIMESTAMP(:timestamp, 'yyyy-MM-dd\\'T\\'HH:mm:ss.SSSXXX')",
                "outputs": [
                    {
                        "description": "Time of electricity consumption",
                        "index": 0,
                        "key": "timestamp",
                        "label": "Timestamp",
                        "type": "timestamp"
                    }
                ]
            },
            {
                "index": 1,
                "formula": "ASSIGN_TO_GROUP(CONCAT('/usa/co/',:city))",
                "outputs": [
                    {
                        "description": "Output group for activity",
                        "index": 0,
                        "key": "output_group",
                        "label": "Output Group",
                        "type": "string"
                    }
                ]
            },
            {
                "index": 2,
                "formula": ":kwh",
                "outputs": [
                    {
                        "description": "kWh of electricity consumption in the month",
                        "index": 0,
                        "key": "kwh",
                        "label": "kWh",
                        "type": "number"
                    }
                ]
            }
        ],
        "parameters": [
            {
                "index": 0,
                "key": "timestamp",
                "label": "Timestamp",
                "description": "Timestamp of electicity consumption",
                "type": "string"
            },
            {
                "index": 1,
                "key": "city",
                "label": "City",
                "description": "City where electricity was consumed",
                "type": "string"
            },
            {
                "index": 2,
                "key": "kwh",
                "label": "kWh",
                "description": "kWh of electricity consumed",
                "type": "number"
            }
        ]
    },
    "dryRunOptions": {
        "data": [
            {
                "timestamp": "2021-04-29T02:23:53.931+00:00",
                "city": "Denver",
                "kwh": 400.4
            }
        ]
    }
}

{
	"attributes": {
		"type": "E2E"
	},
	"name": "Household Electricity Carbon Footprint",
	"description": "E2E test pipeline",
	"processorOptions": {
		"chunkSize": 1
	},
    "connectorConfig": {
        "input": [
         {"name": "sif-csv-pipeline-input-connector"}
        ]
    },
	"transformer": {
		"transforms": [
			{
				"index": 0,
				"formula": "AS_TIMESTAMP(:timestamp, 'yyyy-MM-dd\\'T\\'HH:mm:ss.SSSXXX')",
				"outputs": [
					{
						"description": "Time of electricity consumption",
						"index": 0,
						"key": "timestamp",
						"label": "Timestamp",
						"type": "timestamp"
					}
				]
			},
			{
				"index": 1,
				"formula": ":zipcode",
				"outputs": [
					{
						"description": "Zipcode where electricity consumption occurred",
						"index": 0,
						"key": "zipcode",
						"label": "Zip",
						"type": "string"
					}
				]
			},
			{
				"index": 2,
				"formula": ":kwh",
				"outputs": [
					{
						"description": "kWh of electricity consumption in the month",
						"index": 0,
						"key": "kwh",
						"label": "kWh",
						"type": "number"
					}
				]
			},
			{
				"index": 3,
				"formula": "#electricity_emissions(:kwh,IMPACT(LOOKUP(LOOKUP(LOOKUP(:zipcode, 'ZipcodeToState', 'zipcode', 'state_abbr'), 'StatePrimaryGen', 'state', 'primary_gen'), 'GenToImpact', 'gen', 'if'), 'co2e', 'co2'))",
				"outputs": [
					{
						"description": "CO2e of electricty generation (in tonnes)",
						"index": 0,
						"key": "co2e",
						"label": "CO2e",
						"type": "number",
                        "metrics":["co2e:sum"]
					}
				]
			}
		],
		"parameters": [
			{
				"index": 0,
				"key": "timestamp",
				"label": "Timestamp",
				"description": "Timestamp of electicity consumption",
				"type": "string"
			},
			{
				"index": 1,
				"key": "zipcode",
				"label": "Zipcode",
				"description": "Zipcode of electricity consumption",
				"type": "string"
			},
			{
				"index": 2,
				"key": "kwh",
				"label": "kWh",
				"description": "kWh of electricity generation in the month",
				"type": "number"
			}
		]
	}
}

{
    "name": "ZipcodeToState",
    "description": "Lookup table to find a state from a zipcode",
    "datasetHeaders": [
        "zipcode",
        "state"
    ],
    "datasetSource" : "s3",
    "tags": {
        "source": "usgeo"
    }
}

{
    "name": "ZipcodeToState",
    "description": "Lookup table to find a state from a zipcode",
    "datasetHeaders": [
        "zipcode",
        "state"
    ],
    "data": "zipcode,state\n80238,CO\n98116,WA\n55432,MN\n52172,IA\n75001,TX",
    "tags": {
        "source": "usgeo"
    }
}

{
    "name": "electricity_emissions",
    "summary": "Calculates the emissions from electricity consumption",
    "formula": ":kwh*:ef",
    "parameters": [
        {
            "index": 0,
            "key": "kwh",
            "label": "kWh",
            "description": "Kilowatt hours of electricity consumed",
            "type": "number"
        },
        {
            "index": 1,
            "key": "ef",
            "label": "Emissions Factor",
            "description": "CO2e of polutant per kilowatt hour",
            "type": "number"
        }
    ],
    "outputs": [
        {
            "name": "co2e",
            "description": "CO2 equivalent in tonnes",
            "type": "number"
        }
    ],
    "tags": {
        "type": "test"
    }
}

